export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:10}}},"819RXuFNUj":{data:{id:2641,attributes:{imdbId:"tt0100802",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYzU1YmJjMGEtMjY4Yy00MTFlLWE3NTUtNzI3YjkwZTMxZjZmXkEyXkFqcGdeQXVyNDc2NjEyMw@@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"7.5\u002F10"},{Source:"Rotten Tomatoes",Value:"82%"},{Source:"Metacritic",Value:"57\u002F100"}],item_lang:{data:{id:3304,attributes:{title:"Total Recall",plot:"Douglas Quaid is haunted by a recurring dream about a journey to Mars. He hopes to find out more about this dream and buys a holiday at Rekall Inc. where they sell implanted memories. But something goes wrong with the memory implantation and he remembers being a secret agent fighting against the evil Mars administrator Cohaagen. Now the story really begins and it's a rollercoaster ride until the massive end of the movie.",slug:"total-recall"}}},books:{data:[{id:12641,attributes:{title:g,description:"This volume of the classic stories of Philip K. Dick offers an intriguing glimpse into the early imagination of one of science fiction's most enduring and respected names. Since his untimely death in 1982, interest in Dick's work has continued to mount and his reputation has been enhanced by a growing body of critical attention as well as many films based on his stories and novels. Featuring the story We Can Remember It for You Wholesale, which inspired the major motion picture Total Recall, this collection draws from the writer's earliest fiction, written during the years 1952-55. Also included are fascinating works such as The Adjustment Team (basis of the 2011 movie The Adjustment Bureau), Impostor (basis of the 2001 movie), and many others. \"A useful acquisition for any serious SF library or collection.\" --Kirkus Reviews \"More than anyone else in the field, Mr. Dick really puts you inside people's minds.\" --Wall Street Journal \"The collected stories of Philip K. Dick are awe-inspiring.\" --Washington Post",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9svrAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:true,published:"1990-01-01",publisher:"Citadel Press",subtitle:b}},{id:12642,attributes:{title:g,description:b,thumbnail:b,authors:[d],firstBook:e,published:"1966-01-01",publisher:b,subtitle:b}},{id:12643,attributes:{title:"We Can Remember It for You Wholesale",description:"Features twenty-six stories and novellas written between 1963 and 1981, along with background notes for selected stories.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=W_fsoAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:e,published:"2014-01-01",publisher:"Subterranean Press",subtitle:"1963-1981"}},{id:12644,attributes:{title:"We Can Remember It For You Wholesale",description:"Philip K. Dick was one of the masters of science fiction, and his short stories consistently broke new ground. His work has provided the inspiration for many successful films, including BLADE RUNNER, MINORITY REPORT, PAYCHECK and many more. Here are his final short works, including the story which was the inspiration for TOTAL RECALL. Also included is a selection of other astounding tales, often touching on Dick's most important themes. A man remembers killing his wife - but can he trust his memories? If you were to discover that you were an android, what experiments would you perform on yourself? A supercomputer decides to attack Northern California - can it be talked out of doing the job it was designed for? Can history rewrite itself? All of these questions will be asked as you enter the world of Philip K Dick's remarkable imagination.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=bA6kBQAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Philip K Dick"],firstBook:e,published:"2014-12-22",publisher:"Hachette UK",subtitle:"Volume Five Of The Collected Stories"}},{id:12645,attributes:{title:"Selected Stories of Philip K. Dick",description:"Features twenty-one stories from the well-known science fiction writer, including \"Beyond Lies the Wub,\" \" The Days of Perky Pat,\" and \"The Electric Ant.\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=V1z9rzfTb2EC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:e,published:"2013-01-01",publisher:"Houghton Mifflin Harcourt",subtitle:b}}]}}},meta:{}}},prerenderedAt:1688531249611}}("movie","","series","Philip K. Dick",null,1,"We Can Remember it for You Wholesale"))